On vit une époque formidable :
▪ la Covid est tellement mortelle qu'on doit vous tester pour
savoir si vous l'avez ;
▪ le fabricant de thérapies géniques n'est pas responsable ;
▪ le gouvernement n'est pas responsable;
▪ le piquouzeur n'est pas responsable ;
▪ mais si vous refusez l'injection, VOUS êtes « irresponsable >> ;
▪ en 2020, si vous parliez d'obligation « vaccinale » et de
passe sanitaire, vous étiez complotiste ;
▪ en 2021, si vous refusez l'obligation << vaccinale » et le
passe sanitaire, vous êtes complotiste;
▪ au début, on comptait les morts, puis on n'a plu eu assez de
morts alors on a compté les malades, puis on n'a plus eu assez
de malades alors on a compté les cas, puis on n'a plus eu
assez de cas alors on a compté les variants.
On vit une époque formidable...
